import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 0 auto;
`;
export default () => {
  return (
    <div>
      <Container>Api Connected Website</Container>
    </div>
  );
};
